using System;
using System.Collections.Generic;

namespace _1._7._10
{
    class Program
    {
        static int minSkew(string s)
        {
            int cur = 0;
            int m = 0;
            foreach (var c in s)
            {
                if (c == 'C')
                    cur--;
                if (c == 'G')
                    cur++;
                m = Math.Min(m, cur);
            }
            return m;
        }

        static List<int> minSkews(string s)
        {
            int cur = 0;
            int m = minSkew(s);
            List<int> ans = new List<int>();
            for (int i = 0; i < s.Length; i++)
            {
                var c = s[i];
                if (c == 'C')
                    cur--;
                if (c == 'G')
                    cur++;
                if (cur == m)
                    ans.Add(i + 1);
            }
            return ans;
        }

        static void Main(string[] args)
        {
            foreach (var ans in minSkews(""))
                Console.Write($"{ans} ");
        }
    }
}
